import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from './auth/Login';
import Newuser from './auth/Newuser';

function App() {
	return (
		<BrowserRouter>
			<Routes>
			<Route path="/" element={<Login />} />
				<Route path="/register" element={<Newuser />} />
			</Routes>
		</BrowserRouter>
	);
}

export default App;
